pragma solidity ^0.6.10;
// SPDX-License-Identifier: MIT
contract OldMLM {
     function getAddress(uint _id) public view returns(address payable) {}
     function isMember(address payable _address) public view returns(bool) {}
     function getDirectChilds(address node) public view returns(address, address) {}
}

contract NewMLM {
    function initialize(address payable _parent, address payable _child) public {}
    function initializeDirect(address payable _direct) public {}
    function getMaintainance() public view returns(bool) {}
    function getBeneficiary() public view returns(address) {}
    function isMember(address payable _address) public view returns(bool) {}
}
